import { Component } from '@angular/core';
import { NavController, NavParams, Platform, ActionSheetController, AlertController } from 'ionic-angular';
import { Camera} from 'ionic-native';
import { PostsService } from '../../providers/posts-service';

declare var cordova: any;

@Component({
  selector: 'page-add-post',
  templateUrl: 'add-post.html',
  providers: [PostsService]
})
export class AddPostPage {

  post: any = {
    _id: null,
    author: 'Josh Morony',
    content: '',
    datePublished: '',
    dateUpdated: '',
    title: '',
    type: 'post',
    //_attachments: {}
    _attachments: { "postImage.jpg": {"content_type":"image/jpg", "data": ""}}
  };

  imgURI: any;

  constructor(public navCtrl: NavController, public navParams: NavParams, public postService: PostsService,
              public platform: Platform, public actionsheetCtrl: ActionSheetController, public alertCtrl: AlertController) {}

  ionViewDidLoad() {

  }

  save(){

    // Generate computed fields
    this.post._id = this.post.title.toLowerCase().replace(/ /g,'-').replace(/[^\w-]+/g,'');
    this.post.datePublished = new Date().toISOString();
    this.post.dateUpdated = new Date().toISOString();

    this.postService.addPost(this.post);

    this.navCtrl.pop();

  }

  optionsForType(type: any) {
    let source;
    let destination;
    switch (type) {
      case 0:
        console.log("Cmara.");
        source = Camera.PictureSourceType.CAMERA;
        destination = Camera.DestinationType.FILE_URI;
        break;
      case 1:
        console.log("Galera.");
        source = Camera.PictureSourceType.PHOTOLIBRARY;
        destination = Camera.DestinationType.FILE_URI;
        break;
    }
    // Return options object.
    return {
      destinationType: destination, // URI path in local filesystem.
      sourceType: source,
      allowEdit: false,
      encodingType: Camera.EncodingType.JPEG,
      saveToPhotoAlbum: false,
      correctOrientation:true,
      quality : 100
    };
  }

  getPicture(type: any) {
    let options = this.optionsForType(type);
    Camera.getPicture(options).then((file_uri) => {

      this.imgURI = file_uri;

      let base64Image = "data:image/jpeg;base64," + file_uri; // base64 encoded string.
      this.post._attachments = { "postImage.jpg": {"content_type":"image/jpg", "data": base64Image}};

    }, (err) => {
      console.log("ERROR -> " + JSON.stringify(err))
      this.showAlert('ERROR', JSON.stringify(err) + " Test in mobile phone.");
    });
  }

  openMenu() {
    let actionSheet = this.actionsheetCtrl.create({
      title: 'Choose image',
      cssClass: 'action-sheets-basic-page',
      buttons: [
        {
          text: 'Camera',
          icon: !this.platform.is('ios') ? 'camera' : null,
          handler: () => {
            //console.log('Take Picture Clicked');
            this.getPicture(0);
          }
        },
        {
          text: 'Gallery',
          icon: !this.platform.is('ios') ? 'image' : null,
          handler: () => {
            //console.log('Select picture clicked');
            this.getPicture(1);
          }
        }
      ]
    });
    actionSheet.present();
  }

  showAlert(title: any, subTitle: any) {
    let alert = this.alertCtrl.create({
      title: title,
      subTitle: subTitle,
      buttons: ['OK']
    });
    alert.present();
  }

}